(function(n){new Vue({el:"#app",data:{entity:pageObj.business,showError:!1},methods:{ret:function(){history.go(-1)},save:function(){var t=this.entity;if(!t.appId||!t.secret||!t.mchId||!t.mchKey||!t.weChatAppId||!t.weChatSecret||!t.payServerKey||!t.payServerMchId||!t.certFile||!t.payServerAppId){n.alert("请将信息填写完整");this.showError=!0;return}this.showError=!1;n.loading();axios.post("/business/savesmall",{id:t.id,appId:t.appId,secret:t.secret,mchId:t.mchId,mchKey:t.mchKey,templateNotifyId:t.templateNotifyId,appQrCode:t.appQrCode,weChatAppId:t.weChatAppId,weChatSecret:t.weChatSecret,payServerKey:t.payServerKey,payServerMchId:t.payServerMchId,certFile:t.certFile,payServerAppId:t.payServerAppId}).then(function(t){if(n.loaded(),!t.data.success){n.alert(t.data.msg);return}n.alert("保存成功","success")}).catch(function(t){n.loaded();n.alert(t)})}}})})(jQuery);